import React from 'react';
import { createRoot } from 'react-dom/client';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import GateEntryPage from './components/GateEntryPage';
import Step1 from './components/Step1';
import Step2 from './components/Step2'; // Import the Step2 component
const App = () => {
  return (
    <Router>
      <RouterComponent />
      <Routes>
        <Route path="/gate-entry" element={<GateEntryPage />} />
        <Route path="/step1" element={<Step1 />} />
        <Route path="/step2" element={<Step2 location={window.location} />} />
      </Routes>
    </Router>
  );
};


const root = createRoot(document.getElementById('root'));
